import React from "react";
import { Pagination } from "react-bootstrap";
import NavBar from "./Nav/Nav";
import styles from "./header.module.scss";

const Header = () => {
  return (
    <div>
      <Pagination className={styles.NavArrows}>
        <Pagination.Prev />
        <Pagination.Next />
      </Pagination>
      <NavBar />
    </div>
  );
};

export default Header;
